%spark
// Create review sentiment dataframe
val AFINN = sc.broadcast(sc.textFile("s3://uiuc-cs-498-proj/AFINN-111.txt").map(x=> x.split("\t")).map(x=>(x(0).toString,x(1).toInt)).collect.toMap)
val reviews = sql("select review_id, IF(review_body is null, '', review_body) from amzn_reviews")

val reviewSenti = reviews.map(reviewText => {
  val reviewWordsSentiment = reviewText(1).toString.split(" ").map(word => {
    var senti: Int = 0;
    // if (AFINN.lookup(word.toLowerCase()).length > 0) {
    senti = AFINN.value.getOrElse(word.toLowerCase(), 0)
    // };
    // senti = word.length;
    senti;
  });
  (reviewText(0).toString, reviewWordsSentiment.sum);
//   val reviewSentiment = reviewWordsSentiment.sum
//     (reviewSentiment ,reviewText.toString)
//   reviewSentiment;
})

reviewSenti.toDF("review_id", "sentiment_score").registerTempTable("review_scores")
